import React from 'react';

const HomePage = () => {
  return (
    <div style={{ padding: '100px 20px', textAlign: 'center' }}>
      <h1 style={{ fontSize: '32px', marginBottom: '40px' }}>
        Welcome to OVERTIME
      </h1>
      <p style={{ fontSize: '18px', color: '#aaa' }}>
        Select a sport to get started.
      </p>
    </div>
  );
};

export default HomePage;
